package com.chen.model;

public class Vip {
	private String vip_id;
	private String vip_dec;
	private int vip_point;
	public Vip() {
		super();
		// TODO Auto-generated constructor stub
	}
	public String getVip_id() {
		return vip_id;
	}
	public void setVip_id(String vip_id) {
		this.vip_id = vip_id;
	}
	public String getVip_dec() {
		return vip_dec;
	}
	public void setVip_dec(String vip_dec) {
		this.vip_dec = vip_dec;
	}
	public int getVip_point() {
		return vip_point;
	}
	public void setVip_point(int vip_point) {
		this.vip_point = vip_point;
	}
	
}
